void MemoryFreeLibrary(void *pBuf)
{
	typedef struct _FunParameter {
		const void *data;
	} FunParameter, *PFunParameter;
	PFunParameter pFunPara = (PFunParameter)malloc(sizeof(PFunParameter));
	pFunPara->data = pBuf;
	if (!pFunPara)
		return;

#ifdef _X86_
	int nSize = sizeof(FreeMemoryShellcode32);
	PVOID pStart = NULL;
	if ((pStart = VirtualAlloc(NULL, sizeof(FreeMemoryShellcode32), MEM_COMMIT | MEM_RESERVE, PAGE_EXECUTE_READWRITE)) == NULL)
		return;
	if (!(memcpy(pStart, FreeMemoryShellcode32, sizeof(FreeMemoryShellcode32))))
		return;
	//覆盖地址传参
	DWORD pNew = (DWORD)pStart + (nSize - 9);
	if (!WriteProcessMemory(GetCurrentProcess(), (LPVOID)pNew, (byte*)&pFunPara, 4, NULL))
		return;
#else
	int nSize = sizeof(LoadMemoryShellcode64);
	PVOID pStart = NULL;
	if ((pStart = VirtualAlloc(NULL, sizeof(LoadMemoryShellcode64), MEM_COMMIT | MEM_RESERVE, PAGE_EXECUTE_READWRITE)) == NULL)
		return;
	if (!(memcpy(pStart, LoadMemoryShellcode64, sizeof(LoadMemoryShellcode64))))
		return;
	//覆盖地址传参
	DWORD64 pNew = (DWORD64)pStart + (nSize - 26);
	if (!WriteProcessMemory(GetCurrentProcess(), (LPVOID)pNew, (byte*)&pFunPara, 8, NULL))
		return;
#endif
	typedef void(*PShellCodeStart)();
	PShellCodeStart	xxShellCodeStart = NULL;
	xxShellCodeStart = (PShellCodeStart)pStart;
	xxShellCodeStart();
	VirtualFree(pStart, 0, MEM_RELEASE);
	//free(pBuf);
}